import React, { Component } from "react";

import Navbar from "./Navbar";
import Workspace from "./Workspace";

import BoardList from "./BoardList";

export class App extends Component {
	render() {
		return (
			<div>
				<Navbar />
				<Workspace />
				<BoardList/>
			</div>
		);
	}
}

export default App;
